// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;
pragma abicoder v2;
//import "./Ownable.sol";

//block.timestamp獲取當前時間
//全票20，半票10

///////////功能增加紀錄////////////
//0908補貼計算
//0909身障、愛心補貼
//0912改為整車票證資料整合輸入
//0912將搭乘資料與營運資料整合輸入


///////////需再增加功能///////////
//不用每個都填業者


/////////嘗試增加但未做更改//////////


///////////////限制////////////////
//身障陪同半票/全票如何區分


/////////bug、待處理事項////////////



contract subsidy{
    struct operate_in{   //搭乘資料輸入
        uint8 _number;  //路線編號
        uint8 _operator;  //營運單位
        uint32 _mileage;  //行駛里程 //需乘以1000
        string _plate; //車號
        string _driver; //司機        
        uint16 _normal;  //一般陪同身分別營收 //1->一般、身心障礙陪同(只有虧損補貼)，2->敬老，3->身心障礙
        uint16 _elder;    //敬老營收
        uint16 _elder_actual; //敬老實際收入
        uint16 _disable;    //愛心營收
        uint16 _disable_actual; //愛心實際收入
        uint16 _year;    //上車年份   
        uint8 _month;  //上車月份
        uint8 _day;   //上車日期
        uint16 _time; //上車時間
    }

    mapping (uint => operate_in) map_operate_in;
    uint count_operate=0; //目前跑到多少片

    function operate(uint8 _number, uint8 _operator, uint32 _mileage, string memory _plate, string memory _driver, uint16 _year, uint8 _month, uint8 _day, uint16 _time) public {  //營運資料輸入
        operate_in storage c = map_operate_in[count_operate];  //進去哪一個slide
        c._number=_number;
        c._operator=_operator;
        c._mileage=_mileage;
        c._plate=_plate;
        c._driver=_driver;     
        c._year=_year;
        c._month=_month;
        c._day=_day;
        c._time=_time;
    }
    function passenger(uint16 _normal, uint16 _elder, uint16 _elder_actual, uint16 _disable, uint16 _disable_actual) public {  //搭乘資料輸入
        operate_in storage c = map_operate_in[count_operate];  //進去哪一個slide
        c._normal=_normal;
        c._elder=_elder;
        c._elder_actual=_elder_actual;
        c._disable=_disable;
        c._disable_actual=_disable_actual;  
        count_operate=count_operate+1;
    }

    function subsidy_motc(uint16 year, uint8 season, uint8 number, uint8 operator) public view returns(uint32, uint32){ //更新虧損補貼
        uint32 subsidys=0;   //補貼
        uint32 total_subsidy=0; //總補貼
        uint32 cost=0; //成本
        uint32 total_cost=0; //總成本
        uint32 revenue=0; //營收
        uint32 total_revenue=0; //總營收       
        (cost, total_cost)=subsidy_motc_cost(year, season, number, operator);
        (revenue, total_revenue)=subsidy_motc_revenue(year, season, number, operator);
        subsidys=cost-revenue;
        total_subsidy=total_cost-total_revenue;
        return(subsidys,total_subsidy);    
    }    

    function subsidy_motc_cost(uint16 year, uint8 season, uint8 number, uint8 operator) internal view returns(uint32, uint32){ //更新營運成本
        //year查哪一年，season查第一or第二期，number茶路線編號，operator營運商名稱
        uint32 mileage=0; //路線里程(已被*1000)
        uint32 total_mileage=0; //總路線里程(已被*1000)
        uint32 cost=0; //成本
        uint32 total_cost=0; //總成本
        for(uint16 i=0; i<count_operate; i++){  //算(路線)總里程
            if(operator==map_operate_in[i]._operator){ //若營運單位相同
                if(year==map_operate_in[i]._year){ //若年份相同
                    if(season==1){//若在第一期
                        if(map_operate_in[i]._month==11||map_operate_in[i]._month==12||map_operate_in[i]._month<5){
                            total_mileage=total_mileage+map_operate_in[i]._mileage;//總里程加總
                            if(number==map_operate_in[i]._number)//若同路線
                                mileage=mileage+map_operate_in[i]._mileage; //直接就會是車次*里程(因直接加總)
                        }
                    }
                    else{//若在第二期
                        if(map_operate_in[i]._month>4&&map_operate_in[i]._month<11){
                            total_mileage=total_mileage+map_operate_in[i]._mileage;//總里程加總
                            if(number==map_operate_in[i]._number)//若同路線
                                mileage=mileage+map_operate_in[i]._mileage; //直接就會是車次*里程(因直接加總)
                        }
                    }
                }
            }
        }
        cost=(mileage*24000)/1000000;//假設成本24元每公里 //1000000:單位還原
        total_cost=(total_mileage*24000)/1000000;
        return(cost, total_cost);
    }

    function subsidy_motc_revenue(uint16 year, uint8 season, uint8 number, uint8 operator) internal view returns(uint32, uint32){ //更新營收
        uint32 revenue=0; //營收
        uint32 total_revenue=0; //總營收
        for(uint16 j=0; j<count_operate; j++){//算總營收
            if(operator==map_operate_in[j]._operator){ //若營運單位相同
                if(year==map_operate_in[j]._year){ //若年份相同
                    if(season==1){//若在第一期
                        if(map_operate_in[j]._month==11||map_operate_in[j]._month==12||map_operate_in[j]._month<5){
                            total_revenue=total_revenue+map_operate_in[j]._normal+map_operate_in[j]._elder+map_operate_in[j]._disable;//總收益加總
                            if(number==map_operate_in[j]._number)
                                revenue=revenue+map_operate_in[j]._normal+map_operate_in[j]._elder+map_operate_in[j]._disable;//總收益加總
                        }
                    }
                    else{   //若為第二期
                        if(map_operate_in[j]._month>4&&map_operate_in[j]._month<11){
                            total_revenue=total_revenue+map_operate_in[j]._normal+map_operate_in[j]._elder+map_operate_in[j]._disable;//總收益加總
                            if(number==map_operate_in[j]._number)
                                revenue=revenue+map_operate_in[j]._normal+map_operate_in[j]._elder+map_operate_in[j]._disable;//總收益加總
                        }
                    }
                }
            }
        }
        return(revenue, total_revenue);
    }

    function subsidy_PT(uint16 year, uint8 month, uint8 number, uint8 operator) public view returns(uint32, uint32, uint32, uint32){
        //what:愛心或敬老
        uint32 disable_subsidy; //路線愛心補貼總和
        uint32 disable_total_subsidy;   //公司愛心補貼總和
        uint32 elder_subsidy; //路線敬老補貼總和
        uint32 elder_total_subsidy;   //公司敬老補貼總和
        for(uint16 j=0; j<count_operate; j++){//遍歷所有票證資料
            if(operator==map_operate_in[j]._operator){ //若營運單位相同
                if(year==map_operate_in[j]._year){ //若年份相同
                    if(month==map_operate_in[j]._month){    //若月份相同
                        disable_total_subsidy=disable_total_subsidy+map_operate_in[j]._disable-map_operate_in[j]._disable_actual;  //總補貼金額
                        elder_total_subsidy=elder_total_subsidy+map_operate_in[j]._elder-map_operate_in[j]._elder_actual;  //總補貼金額
                        if(number==map_operate_in[j]._number){
                            disable_subsidy=disable_subsidy+map_operate_in[j]._disable-map_operate_in[j]._disable_actual;  //總補貼金額
                            elder_subsidy=elder_subsidy+map_operate_in[j]._elder-map_operate_in[j]._elder_actual;  //總補貼金額                          
                        }
                    }
                }
            }
        }
        return(disable_subsidy, disable_total_subsidy, elder_subsidy, elder_total_subsidy);
    }
}
